import React, {useState} from 'react';
import { TextField, Button, Typography, Paper } from '@material-ui/core';
import useStyles from './styles';

const Form = () => {
    const [postData, setPostData]= useState({
      writer:'', title: '', blog: '', tags:'', selectedFile: ''});
    const classes =useStyles();
    return (
        <Paper className={classes.paper}>
            <form autoComplete="OFF" noValidate className={classes.from} onSubmit={handleSubmit}>
                <Typography variant="h6"> Create Blog Post</Typography>
                <TextField name="Writer"  variant="outlined"  label="Writer"  fullWidth value={postData.writer} onChange={(e)=>setPostData({ ...postData, writer: e.target.value})}   /> 
                <TextField name="title"  variant="outlined"  label="Title"  fullWidth value={postData.title} onChange={(e)=>setPostData({ ...postData, title: e.target.value})}   /> 
                <TextField name="blog"  variant="outlined"  label="Blog"  fullWidth value={postData.blog} onChange={(e)=>setPostData({ ...postData, blog: e.target.value})}   /> 
                <TextField name="tags"  variant="outlined"  label="Tags"  fullWidth value={postData.tags} onChange={(e)=>setPostData({ ...postData, tags: e.target.value})}   /> 
            </form>
        </Paper>
    );

}
export default Form;
